import java.util.ArrayList;
import java.util.List;

public class EncodeAndDecodeStrings {
    public String encode(List<String> strs) {
        StringBuilder stringBuilder = new StringBuilder();
        for (String str: strs)   {
            int len = str.length();
            stringBuilder.append("#");
            stringBuilder.append(len);
            stringBuilder.append("sika");
            stringBuilder.append(str);
        }
        return stringBuilder.toString();
    }

    public List<String> decode(String str) {
        List<String> strs = new ArrayList<>();
        int i=0;
        while (i < str.length())    {
            int temp = i+1;
            StringBuilder stringBuilder = new StringBuilder();
            while (true)    {
                stringBuilder.append(str.charAt(temp));
                temp++;
                if (str.substring(temp, temp+4).equals("sika"))
                    break;
            }
            String ss = stringBuilder.toString();
            int len = Integer.parseInt(stringBuilder.toString()), startingLen = (ss.length()-1);

            strs.add(str.substring(i+6+startingLen, i+6+startingLen+len));
            i += (6+len+startingLen);
        }
        return strs;
    }
}

